  sortable: true,
},
{
  name: 'Training Category',
  selector: row => row.trainingCategoty,
  sortable: true,
},
{
  name: 'Course Name',
  selector: row => row.courseName,
  sortable: true,
},
{
  name: 'Training Delivery',
  selector: row => row.trainingDelivery,
  sortable: true,
},
{
  name: 'Provider',
  selector: row => row.provider,
  sortable: true,
},
{
  name: 'Instructor Name',
  selector: row => row.instructorName,
  sortable: true,
},
{
  name: 'Start Date Course',
  selector: row => row.startDateCourse,
  sortable: true,
},
{
  name: 'End Date',
  selector: row => row.endDate,
  sortable: true,
},
{
  name: 'Training Satus',
  selector: row => row.trainingStatus,
  sortable: true,
},
{
  name: 'Certificate Expiration Date',
  selector: row => row.certificateExpiration,
  sortable: true,
},
{
  name: 'Upload Certificate',
  selector: row => row.upload,
  sortable: true,
},
{
  name: 'Upload Certificate',
  selector: row => row.download,
  sortable: true,
},
];

const data = [
  {
      id: 1,
      title: 'Beetlejuice',
      year: '1988',
  },
  {
      id: 2,
      title: 'Ghostbusters',
      year: '1984',
  },
]

function TableContent() {
  return (
    <div className='table-responsive'>
      <DataTable
            columns={columns}
            data={data}
            pagination

        />
    </div>
  )
}

export default TableContent
